import React, { useState, useEffect, useRef } from 'react';

const Page4 = () => {
  const values = [
    78, 45, 92, 110, 67, 84, 56, 90, 102, 48, 88, 61, 70, 109, 81, 52, 94, 66, 75, 118,
    44, 95, 104, 63, 71, 85, 39, 111, 79, 59, 73, 113, 87, 40, 103, 68, 82, 119, 50, 97,
    42, 91, 64, 76, 99, 58, 89, 47, 116, 74, 108, 51, 93, 65, 80, 117, 49, 98, 57, 86, 
    38, 112, 77, 60, 72, 115, 83, 41, 101, 69, 96, 53, 100, 62, 114, 54, 107, 46, 120, 
    55, 106, 43, 121, 110, 68, 85, 57, 94, 39, 108, 77, 50, 103, 64, 88, 113, 70, 96, 
    43, 89, 116, 53, 109, 75, 47, 100, 62, 84, 119, 78, 44, 95, 54, 111, 69, 86, 40, 102, 
    59, 117, 65, 91, 42, 99, 58, 79, 114, 73, 118, 48, 106, 56, 92, 41, 110, 63, 87, 105, 
    51, 115, 66, 98, 60, 121, 67, 83, 46, 107, 55, 90, 37, 112, 72, 81, 45, 120, 52, 104, 
    61, 114, 76, 93, 39, 109, 58, 84, 47, 113, 68, 95, 41, 102, 55, 117, 75, 51, 99, 62, 
    88, 111, 72, 44, 107, 56, 91, 40, 118, 64, 85, 49, 103, 59, 116, 70, 92, 42, 97, 67, 
    78, 110, 53, 108, 61, 81, 45, 101, 50, 119, 77, 95, 54, 109, 63, 83, 38, 112, 71, 98, 
    58, 105, 76, 115, 43, 90, 66, 87, 41, 104, 57, 120, 69, 82, 48, 100, 62, 114, 73, 86,
    40, 113, 52, 79, 118, 60, 94, 65, 111, 74, 88, 42, 106, 55, 99, 59, 117, 68, 92, 45
  ];

  const [currentIndex, setCurrentIndex] = useState(0);
  const [dataPoints, setDataPoints] = useState([]);
  const [fixedValue, setFixedValue] = useState(null);
  const canvasRef = useRef(null);

  useEffect(() => {
    const interval = setInterval(() => {
      if (currentIndex < values.length) {
        setDataPoints(prev => [...prev, values[currentIndex]]);
        setCurrentIndex(currentIndex + 1);
      }
    }, 1000); // Интервал в 1 секунду

    return () => clearInterval(interval);
  }, [currentIndex]);

  useEffect(() => {
    const canvas = canvasRef.current;
    const ctx = canvas.getContext('2d');

    if (dataPoints.length > 1) {
      const animateLine = (x1, y1, x2, y2, duration) => {
        const startTime = performance.now();

        const drawFrame = (currentTime) => {
          const elapsed = currentTime - startTime;
          const progress = Math.min(elapsed / duration, 1);

          const currentX = x1 + (x2 - x1) * progress;
          const currentY = y1 + (y2 - y1) * progress;

          ctx.clearRect(0, 0, canvas.width, canvas.height);
          ctx.beginPath();
          ctx.moveTo(x1, y1);
          ctx.lineTo(currentX, currentY);
          ctx.stroke();

          // Отображаем значение на точке
          ctx.fillStyle = ctx.strokeStyle;
          ctx.font = '14px Arial';
          ctx.fillText(dataPoints[dataPoints.length - 2], x1 + 5, y1 - 5);

          // Рисуем фиксированную горизонтальную линию
          if (fixedValue !== null) {
            const fixedY = canvas.height - (fixedValue / 150) * canvas.height;
            ctx.strokeStyle = 'lightblue';
            ctx.lineWidth = 2;
            ctx.beginPath();
            ctx.moveTo(0, fixedY);
            ctx.lineTo(canvas.width, fixedY);
            ctx.stroke();
          }

          if (progress < 1) {
            requestAnimationFrame(drawFrame);
          }
        };

        requestAnimationFrame(drawFrame);
      };

      const x1 = (canvas.width / 2) - (dataPoints.length - 1) * 10;
      const y1 = canvas.height - (dataPoints[dataPoints.length - 2] / 150) * canvas.height;
      const x2 = (canvas.width / 2) - (dataPoints.length - 2) * 10;
      const y2 = canvas.height - (dataPoints[dataPoints.length - 1] / 150) * canvas.height;

      const color = fixedValue !== null ? (dataPoints[dataPoints.length - 1] > fixedValue ? 'green' : 'red') : '#FFD700';
      ctx.strokeStyle = color;
      ctx.lineWidth = 3;

      animateLine(x1, y1, x2, y2, 1000); // Анимация в течение 1 секунды
    }
  }, [dataPoints, fixedValue]);

  const handleFixValue = () => {
    setFixedValue(values[currentIndex - 1]);
  };

  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
      <canvas
        ref={canvasRef}
        width={500}
        height={300}
        style={{ border: '1px solid black', marginBottom: '20px' }}
      ></canvas>
      <button 
        onClick={handleFixValue} 
        style={{
          padding: '10px 20px',
          fontSize: '16px',
          cursor: 'pointer',
          backgroundColor: '#4CAF50',
          color: 'white',
          border: 'none',
          borderRadius: '5px'
        }}>
        Зафиксировать текущее значение
      </button>
    </div>
  );
};

export default Page4;
